import styled from "styled-components";

const UploadButtonStyled = styled.button`
  display: flex;
  align-items: center;
  align-contents: center;
  justify-content: center;
  background-color: #44bd32;
  border-radius: 50px;
  width: 60px;
  height: 60px;
  padding: 0;
  margin: 0;
  font-size: 50px;
  color: #f5f6fa;
`;

export default UploadButtonStyled;
